/*

Nokia 8110 320x240
 - Canvas dimensions: 3200 x 2400
 - Line length: 100
 - x = 2100
 - y = 1000

 iPhone X 2436 x 1125
 - Canvas dimensions: 2400 x 1100

*/

let lineLength = 500;

let x = 14000;
let y = 7000;

function getById(id) {
    return document.getElementById(id);
}

let dragonCurveCanvas = getById("dragonCurveCanvas");
let ctx = dragonCurveCanvas.getContext("2d");
ctx.strokeStyle = "white";
ctx.fillStyle = "white";

function drawDragonCurve(item, index) {

    ctx.beginPath();
    ctx.moveTo(x, y);
    if (item === 0) {
        y = (y - lineLength);
    } else if (item === 1) {
        x = (x + lineLength);
    } else if (item === 2) {
        y = (y + lineLength);
    } else if (item === 3) {
        x = (x - lineLength);
    }
    // ctx.lineTo(x, y);
    function renderSquares() {
        let squareXPos = 0;
        let squareYPos = 0;
        if (item === 0) {
            squareXPos = x;
            squareYPos = y;
        } else if (item === 1) {
            squareXPos = (x - lineLength);
            squareYPos = y;
        } else if (item === 2) {
            squareXPos = (x - lineLength);
            squareYPos = (y - lineLength);
        } else if (item === 3) {
            squareXPos = x;
            squareYPos = (y - lineLength);
        }
        ctx.fillRect(squareXPos, squareYPos, lineLength, lineLength);
    }
    renderSquares();
    // ctx.stroke();
}

function resetXandY() {
    x = 14000;
    y = 7000;
}

dragonCurve.forEach(drawDragonCurve);
resetXandY();
ctx.strokeStyle = "red";
ctx.fillStyle = "red";
dragonCurve90CW.forEach(drawDragonCurve);
