let tileArrangementArray = [];

let tileQuantitiesToOrder = {
    white: 0,
    black: 0,
    red: 0,
    blue: 0,
    green: 0
};

function fillInGap() {
    console.log(dragonCurveCanvas.height);
    console.log(dragonCurveCanvas.width);
    for (let i = 0; i < dragonCurveCanvas.height; i = i + lineLength) {
        let rowArray = [];
        for (let j = 0; j < dragonCurveCanvas.width; j = j + lineLength) {
            let imageData = ctx.getImageData(j, i, lineLength, lineLength);
            if (imageData.data[3] === 0) {
                let priorImageData = ctx.getImageData(j - lineLength, i, lineLength, lineLength,);
                if (j === 0) {
                    priorImageData = ctx.getImageData(j, i - lineLength, lineLength, lineLength);
                }
                ctx.putImageData(priorImageData, j, i);
            }
            let newImageData = ctx.getImageData(j, i, lineLength, lineLength);
            if (newImageData.data[0] === 255) {
                rowArray.push("red");
                tileQuantitiesToOrder.red++;
            } else if (newImageData.data[1] === 128) {
                rowArray.push("green");
                tileQuantitiesToOrder.green++;
            } else if (newImageData.data[2] === 255) {
                rowArray.push("blue");
                tileQuantitiesToOrder.blue++;
            } else {
                rowArray.push("black");
                tileQuantitiesToOrder.black++;
            }
        }
        tileArrangementArray.push(rowArray);
    }
}

fillInGap();

